export interface Schema {
	Continent: Continent;
	ID: string;
	String: string;
	ContinentFilterInput: ContinentFilterInput;
	Country: Country;
	CountryFilterInput: CountryFilterInput;
	Language: Language;
	Boolean: boolean;
	LanguageFilterInput: LanguageFilterInput;
	Query: Query;
	State: State;
	StringQueryOperatorInput: StringQueryOperatorInput;
	Subdivision: Subdivision;
}

export interface Continent {
	__typename(): "Continent";
	code(): string;
	countries(): ReadonlyArray<Country>;
	name(): string;
}

export interface ContinentFilterInput {
	code?: StringQueryOperatorInput;
}

export interface Country {
	__typename(): "Country";
	awsRegion(): string;
	capital(): string | null;
	code(): string;
	continent(): Continent;
	currencies(): ReadonlyArray<string>;
	currency(): string | null;
	emoji(): string;
	emojiU(): string;
	languages(): ReadonlyArray<Language>;
	name(variables: { lang?: string }): string;
	native(): string;
	phone(): string;
	phones(): ReadonlyArray<string>;
	states(): ReadonlyArray<State>;
	subdivisions(): ReadonlyArray<Subdivision>;
}

export interface CountryFilterInput {
	code?: StringQueryOperatorInput;
	continent?: StringQueryOperatorInput;
	currency?: StringQueryOperatorInput;
}

export interface Language {
	__typename(): "Language";
	code(): string;
	name(): string;
	native(): string;
	rtl(): boolean;
}

export interface LanguageFilterInput {
	code?: StringQueryOperatorInput;
}

export interface Query {
	__typename(): "Query";
	continent(variables: { code: string }): Continent | null;
	continents(variables: { filter?: ContinentFilterInput }): ReadonlyArray<Continent>;
	countries(variables: { filter?: CountryFilterInput }): ReadonlyArray<Country>;
	country(variables: { code: string }): Country | null;
	language(variables: { code: string }): Language | null;
	languages(variables: { filter?: LanguageFilterInput }): ReadonlyArray<Language>;
}

export interface State {
	__typename(): "State";
	code(): string | null;
	country(): Country;
	name(): string;
}

export interface StringQueryOperatorInput {
	eq?: string;
	in?: string[];
	ne?: string;
	nin?: string[];
	regex?: string;
}

export interface Subdivision {
	__typename(): "Subdivision";
	code(): string;
	emoji(): string | null;
	name(): string;
}
